import React from 'react';
const listTemplate = () => {
    return (
        <div className="list-item template-list-item" todo-id="" >
            <input type="checkbox" todo-type="check" className="check-box"></input>
            <p todo-type="text-holder">{7+11}</p>
            <button className="buttonClass-done"  todo-type="btn-done">Done</button>
            <button className="buttonClass-x" todo-type = "btn-x">X</button>
        </div>
        );

}

export default listTemplate;
